import React from 'react';
import { Navbar } from "./Components/Navbar";

import { ThemeProvider} from "@material-ui/styles";
import theme from "./Theme";

function App() {
  return (
      <ThemeProvider theme={theme}>
          <div className="App">
              <Navbar />
              hello
          </div>
      </ThemeProvider>
  );
}

export default App;
